import React, { useEffect, useState } from 'react';
import {
  Box,
  Heading,
  Input,
  Button,
  VStack,
  HStack,
  Text,
  useToast,
  Container,
  StackDivider,
  IconButton,
  useColorMode
} from '@chakra-ui/react';
import { DeleteIcon, EditIcon, MoonIcon, SunIcon } from '@chakra-ui/icons';
import {
  getReminders,
  addReminder,
  deleteReminder,
  updateReminder
} from './services/api';

function App() {
  const [form, setForm] = useState({
    medicineName: '',
    dosageTime: '',
    frequency: ''
  });

  const [reminders, setReminders] = useState([]);
  const [editingId, setEditingId] = useState(null);
  const toast = useToast();
  const { colorMode, toggleColorMode } = useColorMode();

  useEffect(() => {
    fetchReminders();
  }, []);

  const fetchReminders = async () => {
    const res = await getReminders();
    setReminders(res.data);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!form.medicineName || !form.dosageTime || !form.frequency) return;

    if (editingId) {
      await updateReminder(editingId, form);
      toast({
        title: 'Reminder updated.',
        status: 'success',
        duration: 2000,
        isClosable: true
      });
    } else {
      await addReminder(form);
      toast({
        title: 'Reminder added.',
        status: 'success',
        duration: 2000,
        isClosable: true
      });
    }

    setForm({ medicineName: '', dosageTime: '', frequency: '' });
    setEditingId(null);
    fetchReminders();
  };

  const handleDelete = async (id) => {
    await deleteReminder(id);
    toast({
      title: 'Reminder deleted.',
      status: 'info',
      duration: 2000,
      isClosable: true
    });
    fetchReminders();
  };

  const handleEdit = (reminder) => {
    setForm({
      medicineName: reminder.medicineName,
      dosageTime: reminder.dosageTime,
      frequency: reminder.frequency
    });
    setEditingId(reminder.id);
  };

  return (
    <Container maxW="lg" py={10}>
      <HStack justify="space-between" mb={4}>
        <Heading color="teal.500">üíä Medicine Reminder App</Heading>
        <IconButton
          icon={colorMode === 'light' ? <MoonIcon /> : <SunIcon />}
          onClick={toggleColorMode}
          isRound
          aria-label="Toggle color mode"
        />
      </HStack>

      <VStack as="form" spacing={4} onSubmit={handleSubmit}>
        <Input
          placeholder="Medicine Name"
          value={form.medicineName}
          onChange={(e) => setForm({ ...form, medicineName: e.target.value })}
        />
        <Input
          placeholder="Dosage Time (e.g. 8:00 AM)"
          value={form.dosageTime}
          onChange={(e) => setForm({ ...form, dosageTime: e.target.value })}
        />
        <Input
          placeholder="Frequency (e.g. Daily)"
          value={form.frequency}
          onChange={(e) => setForm({ ...form, frequency: e.target.value })}
        />
        <Button colorScheme={editingId ? 'yellow' : 'teal'} type="submit" width="100%">
          {editingId ? '‚úèÔ∏è Update Reminder' : '‚ûï Add Reminder'}
        </Button>
      </VStack>

      <Box mt={10}>
        <Heading as="h2" size="md" mb={4}>
          Your Reminders
        </Heading>
        <VStack
          divider={<StackDivider />}
          spacing={4}
          align="stretch"
          borderWidth={1}
          borderRadius="lg"
          p={4}
          bg="gray.50"
          _dark={{ bg: 'gray.700' }}
        >
          {reminders.length === 0 ? (
            <Text color="gray.500" textAlign="center">
              No reminders yet.
            </Text>
          ) : (
            reminders.map((reminder) => (
              <HStack key={reminder.id} justify="space-between">
                <Box>
                  <Text fontWeight="bold">{reminder.medicineName}</Text>
                  <Text fontSize="sm" color="gray.600">
                    {reminder.dosageTime} ‚Äî {reminder.frequency}
                  </Text>
                </Box>
                <HStack spacing={2}>
                  <IconButton
                    icon={<EditIcon />}
                    colorScheme="yellow"
                    size="sm"
                    onClick={() => handleEdit(reminder)}
                  />
                  <IconButton
                    icon={<DeleteIcon />}
                    colorScheme="red"
                    size="sm"
                    onClick={() => handleDelete(reminder.id)}
                  />
                </HStack>
              </HStack>
            ))
          )}
        </VStack>
      </Box>
    </Container>
  );
}

export default App;
